import React from "react";
import { Header, Container, Grid, Image } from 'semantic-ui-react';
import '../style.css';

function RadGradPilotStudy() {
  return (
      <Container>
        <br/>
        <Header as = 'h2' textAlign="center">Rising With RadGrad: A Quantitative Study on Leveling Up Student Retention and Degree Success</Header>
        <Grid textAlign="center">
          <p><span className="bold-list">July 30, 2021</span></p>
        </Grid>
        <Container text>
         <b></b>
        </Container>
        <div className="push"/>
      </Container>


  );
}

export default RadGradPilotStudy;
